const arr = [
  [-1, 5, -1, 9, -1, -1, -1, -1, -1],
  [8, -1, -1, -1, 4, -1, 3, -1, 7],
  [-1, -1, -1, 2, 8, -1, 1, 9, -1],
  [5, 3, 8, 6, -1, 7, 9, 4, -1],
  [-1, 2, -1, 3, -1, 1, -1, -1, -1],
  [1, -1, 9, 8, -1, 4, 6, 2, 3],
  [9, -1, 7, 4, -1, -1, -1, -1, -1],
  [-1, 4, 5, -1, -1, -1, 2, -1, 9],
  [-1, -1, -1, -1, 3, -1, -1, 7, -1]
]
import styled from "styled-components"
function App() {
  return (
    <div className="app">
      <div className="App-header">
        <h3>Sudoku solver</h3>

        <table>
          <tbody>
            {
              [0, 1, 2, 3, 4, 5, 6, 7, 8].map((row, rIndex) => {
                return <tr key={rIndex}>
                   {[0,1,2,3,4,5,6,7,8].map((row,cIndex) => {
                    return<td key={rIndex + cIndex} >
                      <input className="cellInput>" />
                    </td>
                  })}
                </tr>

              })
            }

          </tbody>
        </table>
      </div>
    </div>
  )
}
export default App;
